  number = () => {
    console.log("I AM HER");
    if (this.props.value == 0) {
      return <button className="btn  btn-dark btn-sm">Zero</button>;
    }
    return (
      <button className="btn btn-secondary  btn-sm m-2 ">
        {this.props.value}
      </button>
    );
  };
}

export default Counter;
